import {
  LayerGroup,
  LayersControl,
  Marker,
  Tooltip,
  TileLayer,
  Popup,
} from "react-leaflet";
import { L, Icon } from 'leaflet';
import green from '../../assets/images/green.png';
import red from '../../assets/images/red.png';
import blue from '../../assets/images/blue.png';


const Map = ({ zoom, coords }) => {

  return (
    <LayersControl position="topright">
      <LayersControl.BaseLayer checked name="Basemap">
        <TileLayer url="tiles/{z}/{x}/{y}.png" noWrap={true} />
      </LayersControl.BaseLayer>

      <Marker position={[-101, 65]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Rockholm
        </Popup>
      </Marker>

      <Marker position={[-126.5, 77.7]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Midgraad
        </Popup>
      </Marker>

      <Marker position={[-159.8, 162.2]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Ta'Lorial
        </Popup>
      </Marker>

      <Marker position={[-197.5, 134.8]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Drathguul
        </Popup>
      </Marker>

      <Marker position={[-87, 170]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Normarc
        </Popup>
      </Marker>

      <Marker position={[-159.5, 38]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Faas
        </Popup>
      </Marker>

    </LayersControl>
  );
};
export default Map;
